INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (0.0, -416.5, "2030/01/01 14:59:59", 130211, 0.0, "フブキ", 3002100, 1, "2024/10/31 12:00:00", "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 100, 1, 3002);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (0.0, -416.5, "2030/01/01 14:59:59", 130211, 0.0, "フブキ", 3002101, 1, "2024/10/31 12:00:00", "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 101, 1, 3002);
